import React from "react";
import { Link } from "react-router-dom";
import style from './navbar.module.css';

export const Navbar = () => {
  return (
    <div className={ style.container }>
        <Link to="/" className={ style.logo }>
          <img src="img/logo.png" alt="" />
        </Link>
        <br/>
        <ul className={style.ul}>
            <li className={style.li}><Link to="/home">Pokedex</Link></li>
            &nbsp;
            <li className={style.li}><Link to="/create">Create</Link></li>
            &nbsp;
            <li className={style.li}><Link to="/team">My team</Link></li>
        </ul>
    </div>
  );
};
